import sol from "../../leetcode/_10.js";
describe("leetcode#_10", function () {
  test("basic", function () {
    let a = "abda";
    let b = "acmc";
    expect(sol(a, b)).toBe(false);

    a = "ulacfd";
    b = "jizalu";
    expect(sol(a, b)).toBe(true);

    a = "abcewq";
    b = "qwezzz";
    expect(sol(a, b)).toBe(true);

    a = "ulabc";
    b = "zzklu";
    expect(sol(a, b)).toBe(true);

    a = "ulzabc";
    b = "zzkklu";
    expect(sol(a, b)).toBe(true);

    a = "ulzoabc";
    b = "zzkbklu";
    expect(sol(a, b)).toBe(true);

    a = "abdef";
    b = "fecab";
    expect(sol(a, b)).toBe(true);

    a =
      "";
    b =
      "";
    expect(sol(a, b)).toBe(true);
  });
});
